import React from "react";
import ReactPlayer from "react-player";
import quizOneBackground from "../visuals/quiz/q1_background.mp4";
import title from "../images/quiz/q1/title.png";
import placeholder from "../images/quiz/q1/background_placeholder.png";
import { Redirect } from "react-router-dom";

export default function questionOne() {
  // let input=document.getElementById(demo);
  // input.addEventListener('submit', function(){
  //   console.log('hello');
  // })
  function handleSubmit(e) {
    e.preventDefault();
    this.props.history.push("/question-two");
  }
  return (
    <div className="questionContainer">
      <img src={placeholder} alt={placeholder} className="bg-placeholder" />
      {/* <ReactPlayer
        className="bg-placeholder"
        url={quizOneBackground}
        width="100%"
        height="100%"
        controls={false}
        loop={true}
        playing={true}
      /> */}
      <div className="questionThree_container">
        <div className="title_container">
          <img src={title} alt="" className="question_title" />
        </div>
        <form onSubmit={handleSubmit}>
          <label>
            <input
              type="text"
              placeholder="Write here"
              className="q1_text"
              id="demo"
            />
          </label>
        </form>
      </div>
    </div>
  );
}
